import React, {useEffect, useState} from "react";
import nullPhoto from "../assets/img/Vector.png"
import axios from "axios";
import styled from "styled-components";
import { BASE_URL } from "../utils/API/axios";


const MyIntroduce = () => {
    const [dataList, setDataList] = useState([]);

    useEffect(
        () => {
            axios.get(`${BASE_URL}/users/mypage`,
                { headers: { Authorization: `Bearer ${localStorage.getItem("token")}` } })
                .then((Response) => {
                    console.log(Response.data)
                    setDataList(Response.data)
                })
                .catch((error) => {
                    alert("실패")
                })
        }, [])
    return(
        <>
            <PhotoBorder>
                <PhotoImg src={nullPhoto}></PhotoImg>
            </PhotoBorder>
            <div>{dataList.name}</div>
        </>
    )
}

export default MyIntroduce

const PhotoBorder = styled.div`
    border: 1px solid black;
    border-radius: 50%;
    width: 90px;
    height: 90px;
`

const PhotoImg = styled.img`
    position: absolute;

`
